BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" text NOT NULL);
CREATE TABLE "mice" ("id" SERIAL PRIMARY KEY NOT NULL, "sex" text, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL, "species_strain" varchar, "date_of_birth" timestamp, "number" integer, "comment" text, "cage_number" varchar);
CREATE TABLE "cells" ("id" INTEGER PRIMARY KEY  NOT NULL ,"cell_type" text,"created_at" timestamp NOT NULL ,"updated_at" timestamp NOT NULL ,"channel" integer,"brain_area" varchar,"layer" varchar,"intracellular" varchar,"pipette_offset" decimal,"pipette_resistance" decimal,"depth" integer,"temparature" decimal,"experiment_number" varchar,"comment" text,"mouse_id" integer);
CREATE TABLE "analyses" ("id" INTEGER PRIMARY KEY  NOT NULL ,"created_at" timestamp NOT NULL ,"updated_at" timestamp NOT NULL ,"file" text,"analysis_type" text,"comment" text, "cell_id" integer);

CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
CREATE INDEX "index_analyses_on_cell_id" ON "analyses" ("cell_id");
COMMIT;
